import React from 'react';
import Wizard from './Wizard';

class App extends React.Component{

    constructor(props){
        super(props);
        this.state = {
            forms:[]
        };
      
    }
    createForm=()=>{
        console.log(this);
    }
    render(){
        return(
            <div className="ui container" style={{marginTop:'10px'}}>
                <Wizard GetFormJson={this.createForm}/>
                </div>
        );
    }

}


export default App;
